# LEADING ORDER,ONE-LOOP, AND TWO-LOOP FORM FACTORS

def form_factor_loop(p):

    s, Ang, Sq, GlobFac_3, GlobFac_4 = helicities.helicities(3, p)

    # Define the matrix of form factors A[form factor number][number of loops]
    A = np.zeros((4, 3), dtype=complex)

    # Loading order form factors
    A[1][0] = 2
    A[2][0] = 0
    A[3][0] = 1

    # One-loop form factors
    A[1][1] = - const.Cf * (8 + cmath.log(-const.mu2 / s[1,2]))
    A[2][1] = 0
    A[3][1] = -4 * const.Cf

    # One-loop form factors
    A[1][2] = const.Cf / 51840 * (
            20 * (24907 * const.CA - 43956 * const.Cf - 3862 * const.Nf - 4536 * const.beta0) 
            + 15 * (403 * const.CA + 432 * const.Cf - 58 * const.Nf + 36 * (4 + 3 * math.pi) * const.beta0) * math.pi**2 
            + 9 * (-83 * const.CA + 184 * const.Cf) * math.pi**4 
            + 360 * (-593 * const.CA + 1002 * const.Cf + 26 * const.Nf + 6 * (14 + 3 * math.pi) * const.beta0) * zetazero(3) 
            - 60 * (-5245 * const.CA + 12879 * const.Cf + 802 * const.Nf + 2 * (432 - 635 * math.pi) * const.beta0 
            + 3 * (-55 * const.CA + 54 * const.Cf + 10 * const.Nf + 18 * (-1 + 4 * math.pi) * const.beta0) * math.pi**2 
            + 216 * (13 * const.CA - 20 * const.Cf) * zetazero(3)) * cmath.log(-const.mu2 / s[1,2]) 
            - 180 * (-532 * const.CA + 1341 * const.Cf + 88 * const.Nf + 36 * (2 - 3 * math.pi) * const.beta0 
            + 12 * const.CA * math.pi**2) * (cmath.log(-const.mu2 / s[1,2]))**2 
            - 720 * (-11 * const.CA + 21 * const.Cf + 2 * const.Nf + 3 * const.beta0 * (1 - 2 * math.pi)) * (cmath.log(-const.mu2 / s[1,2]))**3)
    A[2][2] = 0
    A[3][2] = const.Cf / 103680 * (
            5 * (134581 * const.CA - 20655 * const.Cf - 23338 * const.Nf - 20736 * const.beta0) 
            + 45 * (49 * const.CA + 48 * const.Cf + 2 * const.Nf - 20 * (-1 + math.pi) * const.beta0) * math.pi**2 
            + 9 * (-93 * const.CA + 76 * const.Cf) * math.pi**4 
            - 360 * (467 * const.CA - 342 * const.Cf - 26 * const.Nf + 6 * (-14 + 3 * math.pi) * const.beta0) * zetazero(3) 
            + 6 * (-16 * (9 + 7 * math.pi) * const.beta0 + 3 * (1 + 4 * math.pi) * math.pi**2 * const.beta0 + 48 * const.Cf * zetazero(3)) * cmath.log(-const.mu2 / s[1,2]) 
            - 1080 * (-33 * const.CA + 54 * const.Cf + 6 * const.Nf + 9 * const.beta0 * (1 + 2 * math.pi) - 4 * const.Cf * math.pi**2) * (cmath.log(-const.mu2 / s[1,2]))**2 
            - 720 * (-11 * const.CA + 72 * const.Cf + 2 * const.Nf + const.beta0 * (3 + 6 * math.pi)) * (cmath.log(-const.mu2 / s[1,2]))**3 
            - 8640 * const.Cf * (cmath.log(-const.mu2 / s[1,2]))**4)

    # print form factors A and B
    """
    print("\n3-point leading order, one-loop, and two-loop form factors:\n")
    print(A)
    print("\n4-point leading order, one-loop, and two-loop form factors:\n")
    print(A)
    """

    return A



